class MovieForm extends Component {
  render() {
    return (
      <>
        <div>
          <form>
            Movie Title: <input></input>
            <br />
            Director: <input></input>
            <br />
            Year of Release:<input></input> <br />
            <br />
            <button>Add Movie</button>
          </form>
        </div>
      </>
    );
  }
}

export default MovieForm;
